import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";
const Ncard = (val) => {
  return <Card imgsrc={val.imgsrc} />;
};

const Netflix = () => {
  return (
    <>
      <h1 className="heading-style">List of TOP Most Webseries in Netflix</h1>
      {Sdata.map(Ncard)}
    </>
  );
};

export default Netflix;
